if (
  window.navigator.userAgent.match(
    /(phone|pad|pod|iPhone|iPad|iPod|ios|Android|Mobile|BlackBerry|IEMobile|MQQBrowser|JUC|Fennec|wOSBrowser|BrowserNG|WebOS|Symbian|Windows Phone)/i
  )
) {
  return 'mobile'
} else {
  // 此时为null
  return 'pc'
}
